import "./landing.scss";
import smile from "../../img/smile.svg";
import { useEffect, useRef } from "react";
import { init } from "ityped";

export default function Landing() {
  const refOne = useRef();
  const refTwo = useRef();
  const refThree = useRef();
  const refFour = useRef();
  useEffect(() => {
    init(refOne.current, {
      showCursor: true,
      backDelay: 1000,
      backSpeed: 60,
      strings: ["Software Developer"],
    });
    init(refTwo.current, {
      showCursor: true,
      backDelay: 2000,
      backSpeed: 60,
      strings: ["Technical Writer"],
    });
    init(refThree.current, {
      showCursor: true,
      backDelay: 1000,
      backSpeed: 60,
      strings: ["IT Generalist"],
    });
    init(refFour.current, {
      showCursor: true,
      backDelay: 1000,
      backSpeed: 60,
      strings: ["Security Enthusiast"],
    });
  });
  return (
    <div className="landing">
      <div className="heading-wrapper">
        <h1>Digital Carpentry</h1>
        <h1>
          Turning Ideas &gt;
          <img className="smile-icon" src={smile} alt=""></img>
        </h1>
        <p className="text-fade-in upper-text">Meet Tobias</p>
        <div className="text-fade-in text-wrapper">
          <p ref={refOne}></p>
          <p ref={refTwo}></p>
          <p ref={refThree}></p>
          <p ref={refFour}></p>
        </div>
        <span></span>
      </div>
    </div>
  );
}
